import React from "react";
import IndexNav from "../../components/navigation/IndexNav";
import IndexVisualCarousel from "../../components/carousel/IndexVisualCarousel";
import Clearfix from "../../components/layout/Clearfix";
import ReserveLargeButton from "../../components/button/ReserveLargeButton";
import BoatListItem01 from "../../components/item/BoatListItem01";

export default class Page extends React.Component {
  render() {
    return (
      <>
        {/** Navigation */}
        <IndexNav onSearchClick={() => console.log("link::search.html")} />
        {/** Visual Carousel */}
        <IndexVisualCarousel />
        <Clearfix />
        {/** Quick Link */}
        <div className="container">
          <nav className="nav nav-pills quick nav-justified">
            <ReserveLargeButton
              imgSrc={"/assets/img/svg/quick-boat.svg"}
              text={"선상 실시간 예약"}
              onClick={() => console.log("link::search-reserv.html")}
            />{" "}
            &nbsp;&nbsp;
            <ReserveLargeButton
              imgSrc={"/assets/img/svg/quick-rocks.svg"}
              text={"갯바위 실시간 예약"}
              onClick={() => console.log("link::search-reserv.html")}
            />
          </nav>
        </div>
        <Clearfix />
        {/** Contents */}
        <div className="container nopadding">
          {/** 실시간 조황 */}
          <h5>실시간 조황</h5>
          <div className="slideList">
            <ul className="listWrap">
              <BoatListItem01
                onClick={() => console.log("link::boat-detail.html")}
                imgSrc={"/assets/img/sample/live1.jpg"}
                isLive={true}
                title={"챔피온 1호"}
                textPrimary={"돌문어"}
                location={"전남 여수시"}
              />

              <li className="item more">
                <a href="boat.html" className="moreLink">
                  <div className="inner">
                    <span>더보기</span>
                  </div>
                </a>
              </li>
            </ul>
          </div>
        </div>
      </>
    );
  }
}
